'use client'

import React, { useState, useEffect } from 'react'
import { generate } from '@pdfme/generator'
import { Template, BLANK_PDF } from '@pdfme/common'
import { text, image, barcodes } from '@pdfme/schemas'

import generateDataMatrixBarcode from './OrderDataMatrix'
import { Button } from '../ui/button'
import { Loader2, Truck } from 'lucide-react'

interface PdfGeneratorProps {
  postcode: string
  courierType: string
  shippingUnits: string
  address: string
  jobId: string
  orderId: string
  orderDate: string
  dispatchDate: string
  deliveryDate: string
  note: string
  itemName: string
  code: string
  gs1: string
}

const PdfGeneratorComponent: React.FC<PdfGeneratorProps> = ({
  postcode,
  courierType,
  shippingUnits,
  address,
  jobId,
  orderId,
  orderDate,
  dispatchDate,
  deliveryDate,
  note,
  itemName,
  code,
  gs1,
}) => {
  const [pdfData, setPdfData] = useState<ArrayBuffer | null>(null)
  const [isLoading, setIsLoading] = useState(true) // State to track the loading status

  useEffect(() => {
    const generatePdfOnLoad = async () => {
      // Load the fonts using the fetch API
      const customFontBuffer = await fetch('/fonts/JetBrainsMono-Bold.ttf').then(
        (res) => res.arrayBuffer()
      )

      const font = {
        custom: {
          data: customFontBuffer,
          fallback: true,
        },
      }

      // Define the template and inputs here, or receive them as props
      const template: Template = {
        schemas: [
          {
            owner: {
              type: 'qrcode',
              position: {
                x: 240.01568350000002,
                y: 447.40905430000004,
              },
              width: 26.53,
              height: 26.53,
            },
            datamatrix: {
              type: 'image',
              position: {
                x: 7.68,
                y: 7.93,
              },
              width: 23,
              height: 23,
            },
            postcode: {
              type: 'text',
              position: {
                x: 35.72,
                y: 9.26,
              },
              width: 55.9,
              height: 12.03,
              alignment: 'left',
              fontSize: 27,
              characterSpacing: 0,
              lineHeight: 1,
              fontName: 'custom',
            },
            couriertype: {
              type: 'text',
              position: {
                x: 36.99,
                y: 26.46,
              },
              width: 29.97,
              height: 5.94,
              alignment: 'left',
              fontSize: 9,
              characterSpacing: 0,
              lineHeight: 1,
              fontName: 'custom',
              fontColor: '#ffffff',
            },
            shippingunits: {
              type: 'text',
              position: {
                x: 75.31,
                y: 26.02,
              },
              width: 15.95,
              height: 7,
              alignment: 'left',
              fontSize: 13,
              characterSpacing: 0,
              lineHeight: 1,
              fontName: 'custom',
              fontColor: '#ffffff',
            },
            address: {
              type: 'text',
              position: {
                x: 9.26,
                y: 36.78,
              },
              width: 76.8,
              height: 35.57,
              alignment: 'left',
              fontSize: 16,
              characterSpacing: 0,
              lineHeight: 1.2,
              fontName: 'custom',
            },
            job: {
              type: 'text',
              position: {
                x: 8.73,
                y: 81.07,
              },
              width: 58.02,
              height: 7,
              alignment: 'left',
              fontSize: 10,
              characterSpacing: 0,
              lineHeight: 1,
              fontName: 'custom',
            },
            order: {
              type: 'text',
              position: {
                x: 45,
                y: 81.07,
              },
              width: 58.02,
              height: 7,
              alignment: 'left',
              fontSize: 10,
              characterSpacing: 0,
              lineHeight: 1,
              fontName: 'custom',
            },
            'order copy': {
              type: 'text',
              position: {
                x: 8.56,
                y: 86.37,
              },
              width: 58.02,
              height: 7,
              alignment: 'left',
              fontSize: 8.5,
              characterSpacing: 0,
              lineHeight: 1,
              fontName: 'custom',
            },
            orderdate: {
              type: 'text',
              position: {
                x: 8.41,
                y: 99.74,
              },
              width: 58.02,
              height: 7,
              alignment: 'left',
              fontSize: 10,
              characterSpacing: 0,
              lineHeight: 1,
              fontName: 'custom',
            },
            dispachdate: {
              type: 'text',
              position: {
                x: 8.78,
                y: 104.88,
              },
              width: 58.02,
              height: 7,
              alignment: 'left',
              fontSize: 10,
              characterSpacing: 0,
              lineHeight: 1,
              fontName: 'custom',
            },
            'delivery date': {
              type: 'text',
              position: {
                x: 8.56,
                y: 109.81,
              },
              width: 58.02,
              height: 7,
              alignment: 'left',
              fontSize: 10,
              characterSpacing: 0,
              lineHeight: 1,
              fontName: 'custom',
            },
            note: {
              type: 'text',
              position: {
                x: 9.04,
                y: 124.31,
              },
              width: 71.78,
              height: 19.7,
              alignment: 'left',
              fontSize: 10,
              characterSpacing: 0,
              lineHeight: 1,
              fontName: 'custom',
            },
            datamatrix2: {
              type: 'image',
              position: {
                x: 83.34,
                y: 86.06,
              },
              width: 10,
              height: 10,
            },
          },
        ],
        basePdf:
          'data:application/pdf;base64,',
      }

      async function createShippingObjects(inputs: any[]) {
        const shippingUnits = Number(inputs[0].shippingunits)
        const jobId = inputs[0].job
        const baseCode = inputs[0].datamatrix

        const result = []

        for (let i = 1; i <= shippingUnits; i++) {
          const appendedCode = `${baseCode}(${i
            .toString()
            .padStart(2, '0')
            .toString()
            .padStart(2, '0')})`

          const appendedCodeWithPostcode =
            appendedCode + (postcode ? ` ${postcode}` : '')

          const generatedMatrix = await generateDataMatrixBarcode(
            appendedCodeWithPostcode,
            'azteccodecompact'
          )

          const shippingObject = {
            ...inputs[0],
            shippingunits: `${i.toString().padStart(2, '0')}/${shippingUnits
              .toString()
              .padStart(2, '0')}`,
            job: `${jobId}/${i
              .toString()
              .padStart(2, '0')
              .toString()
              .padStart(2, '0')}`,
            datamatrix: generatedMatrix,
          }
          result.push(shippingObject)
        }

        return result
      }

      // The rest of the main code remains the same.

      const img = await generateDataMatrixBarcode(gs1, 'datamatrix')

      let inputs = [
        {
          owner: 'https://manufi.io/',
          datamatrix: code,
          postcode: postcode,
          couriertype: courierType,
          shippingunits: shippingUnits,
          address: address,
          job: jobId,
          order: orderId,
          'order copy': itemName,
          orderdate: orderDate,
          dispachdate: dispatchDate,
          'delivery date': deliveryDate,
          note: note,
          datamatrix2: img,
        },
      ]

      const generatedShippingObjects = await createShippingObjects(inputs)
      inputs = generatedShippingObjects

      try {
        const pdf = await generate({
          template,
          inputs,
          plugins: {
            text,
            image,
            qrcode: barcodes.qrcode,
          },
          options: { font },
        })
        setPdfData(pdf.buffer)
      } catch (error) {
        console.error('Error generating PDF:', error)
      } finally {
        setIsLoading(false) // Set loading status to false once generation is complete
      }
    }
    generatePdfOnLoad()
  }, [
    address,
    code,
    courierType,
    deliveryDate,
    dispatchDate,
    gs1,
    itemName,
    jobId,
    note,
    orderDate,
    orderId,
    postcode,
    shippingUnits,
  ])

  const handleDownloadPdf = () => {
    if (!pdfData) {
      console.error('No PDF data available for download.')
      return
    }

    try {
      const blob = new Blob([pdfData], { type: 'application/pdf' })
      const url = URL.createObjectURL(blob)
      const link = document.createElement('a')
      link.href = url
      link.download = 'generated.pdf'
      link.click()
      URL.revokeObjectURL(url)
    } catch (error) {
      console.error('Error during PDF download:', error)
    }
  }

  return (
    <div>
      {isLoading ? (
        <>
          <Button disabled size='sm' variant='outline' className='h-8 gap-1'>
            <Loader2 className='mr-2 h-4 w-4 animate-spin' />
            Generating PDF...
          </Button>
        </>
      ) : (
        <Button
          onClick={handleDownloadPdf}
          size='sm'
          variant='outline'
          className='h-8 gap-1 white-glow'
        >
          <Truck className='h-3.5 w-3.5' />
          Shipping Label
        </Button>
      )}
    </div>
  )
}

export default PdfGeneratorComponent
